import React, { useEffect } from 'react';
import { useAuth } from '../context/authcontext';
import { useParams, useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import './card.scss';

const Card = () => {

  const id = useParams()
  console.log('bug',id)

  const navigate = useNavigate();

  const { DisplayPlans, plans, DisplayPlan } = useAuth();
  useEffect(() => {
    DisplayPlans();
  }, []);

  const isLoggedIn = localStorage.getItem('signature');

  const handleClick = (id)=>{
    {isLoggedIn ? (
      DisplayPlan(id)
    ) : (
      navigate('/login')
    )}

  }


  return (
    <div className="container">
      <div className="title1 title1--mod">
        <h2>Health Plans</h2>
      </div>
      <div className="flex">
        {plans.map((plan) => (
          <div key={plan._id} className="card">
            <div className="shop-plan">
              <h3>{plan.plan_type}</h3>
            </div>
            <div className="card-items">
              <div className="card-content">
                <div>
                  <h3>Number of member: {plan.number_of_members}</h3>
                  <h3>Total package: ${plan.planPrice}</h3>
                </div>
                <div className="main-content">
                  <h3>Benefits</h3>
                  {plan.packages.map((elem) => (
                    <p>{elem}</p>
                  ))}
              <div className="card-content">
                <button className="card-btn" onClick={() => handleClick(plan._id)}>Subscribe</button>
              </div>
                </div>
              </div>

            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Card;
